import React, {Component} from 'react';
import ReactDOM from 'react-dom';

export default function App(){
  return(
    <div>
      <NewPaymentButton />
      <NewTaskButton />
    </div>
  );
}
function NewTaskButton(){
  return(
  <button>
    Ingresar Tarea
  </button>
  );
}
function NewPaymentButton(){
  return(
  <button>
    Ingresar Pago
  </button>
  );
}
